# month별 wind 속도의 평균 추가
month_wind_mean = df.groupby('month')['wind'].mean()
df['month_wind_mean'] = df['month'].map(month_wind_mean)

# month별 pressure의 중앙값 추가
month_pressure_median = df.groupby('month')['pressure'].median()
df['month_pressure_median'] = df['month'].map(month_pressure_median)

# month 변수의 빈도 인코딩
month_freq = df['month'].value_counts(normalize=True)  # 각 월의 빈도 비율 계산
df['month_freq_encoded'] = df['month'].map(month_freq)

# 태풍별 시작 시간 계산
df = df.sort_values(by=['name', 'datetime'])  # 태풍별 시간순 정렬
start_times = df.groupby('name')['datetime'].transform('min')  # 각 태풍의 시작 시간
df['time_elapsed'] = (df['datetime'] - start_times).dt.total_seconds() / 3600  # 경과 시간을 시간 단위로 계산

